import React, { useState } from 'react';
import { useSprings, animated } from '@react-spring/web';
import { useDrag } from '@use-gesture/react';
import './Discovery.css';

const Discovery = () => {
  const [currentImageIndex, setCurrentImageIndex] = useState({});
  const [showProfile, setShowProfile] = useState({});
  const [gone] = useState(() => new Set());
  
  const [people] = useState([
    {
      name: 'Sarah',
      age: 25,
      distance: '5 km',
      bio: "Hi! I'm Sarah, a freelance photographer who loves to travel and capture beautiful moments. I'm passionate about art, music, and trying new cuisines.",
      about: "Looking for someone who shares my adventurous spirit and can make me laugh. Let's explore the world together! üåé‚úàÔ∏è",
      interests: ['Photography üì∏', 'Traveling ‚úàÔ∏è', 'Music üéµ', 'Cooking üë©‚Äçüç≥', 'Hiking üèÉ‚Äç‚ôÄÔ∏è'],
      occupation: 'Freelance Photographer',
      education: 'Bachelor of Fine Arts',
      location: 'Downtown Toronto',
      images: [
        'https://picsum.photos/400/600?random=1',
        'https://picsum.photos/400/600?random=2',
        'https://picsum.photos/400/600?random=3',
        'https://picsum.photos/400/600?random=4'
      ]
    },
    {
      name: 'Emma',
      age: 28,
      distance: '3 km',
      bio: "Hey there! I'm Emma, a software engineer by day and a bookworm by night. I love coding, reading sci-fi novels, and playing board games.",
      about: "Looking for someone who can appreciate both intellectual conversations and silly jokes. Coffee enthusiast and proud cat mom! üê±",
      interests: ['Coding üíª', 'Reading üìö', 'Board Games üé≤', 'Coffee ‚òï', 'Cats üê±'],
      occupation: 'Software Engineer',
      education: 'Master in Computer Science',
      location: 'Midtown',
      images: [
        'https://picsum.photos/400/600?random=5',
        'https://picsum.photos/400/600?random=6',
        'https://picsum.photos/400/600?random=7',
        'https://picsum.photos/400/600?random=8'
      ]
    }
  ]);

  const [props, api] = useSprings(people.length, i => ({
    x: 0,
    y: 0,
    rotation: 0,
    scale: 1,
    zIndex: people.length - i
  }));

  const handleBasicInfoClick = (index, e) => {
    e.stopPropagation();
    setShowProfile(prev => ({
      ...prev,
      [index]: !prev[index]
    }));
  };

  const handlePhotoNavigation = (e, personIndex) => {
    e.stopPropagation();
    const rect = e.currentTarget.getBoundingClientRect();
    const x = e.clientX - rect.left;
    const width = rect.width;
    
    setShowProfile(prev => ({
      ...prev,
      [personIndex]: false
    }));
    
    if (x < width / 3) {
      setCurrentImageIndex(prev => ({
        ...prev,
        [personIndex]: ((prev[personIndex] || 0) - 1 + people[personIndex].images.length) % people[personIndex].images.length
      }));
    } else if (x > (width * 2) / 3) {
      setCurrentImageIndex(prev => ({
        ...prev,
        [personIndex]: ((prev[personIndex] || 0) + 1) % people[personIndex].images.length
      }));
    }
  };

  const bind = useDrag(({ args: [index], active, movement: [mx], direction: [xDir], velocity }) => {
    const trigger = velocity > 0.2;
    const dir = xDir < 0 ? -1 : 1;

    if (!active && trigger) {
      gone.add(index);
    }

    api.start(i => {
      if (index !== i) return;
      const isGone = gone.has(index);
      const x = isGone ? (200 + window.innerWidth) * dir : active ? mx : 0;
      const rotation = mx / 100 + (isGone ? dir * 10 * velocity : 0);
      return {
        x,
        rotation,
        scale: active ? 1.1 : 1,
        config: { friction: 50, tension: active ? 800 : isGone ? 200 : 500 }
      };
    });
  });

  const handleButtonClick = (direction, index) => {
    if (gone.has(index)) return;
    gone.add(index);
    
    api.start(i => {
      if (index !== i) return;
      const x = (200 + window.innerWidth) * (direction === 'right' ? 1 : -1);
      return {
        x,
        rotation: (direction === 'right' ? 1 : -1) * 30,
        config: { friction: 50, tension: 200 }
      };
    });
  };

  const remainingProfiles = people.length - gone.size;
  const currentIndex = people.length - 1 - gone.size;

  const handleRefresh = () => {
    gone.clear();
    api.start(i => ({
      x: 0,
      y: 0,
      rotation: 0,
      scale: 1
    }));
  };

  return (
    <div className="discovery-container">
      {remainingProfiles > 0 ? (
        <div className="card-container">
          {props.map(({ x, y, rotation, scale }, index) => (
            <animated.div
              key={index}
              className="card-wrapper"
              style={{
                transform: x.to(x => `translate3d(${x}px,${y}px,0)`)
              }}
            >
              <animated.div
                {...bind(index)}
                style={{
                  transform: rotation.to(r => `rotate(${r}deg)`),
                  scale: scale
                }}
                className="card"
              >
                <img 
                  src={people[index].images[currentImageIndex[index] || 0]}
                  alt={people[index].name}
                />
                <div 
                  className="photo-navigation"
                  onClick={(e) => handlePhotoNavigation(e, index)}
                >
                  <div className="photo-nav-area" />
                  <div className="photo-nav-area" />
                  <div className="photo-nav-area" />
                </div>
                <div className="image-indicators">
                  {people[index].images.map((_, imgIndex) => (
                    <span
                      key={imgIndex}
                      className={`indicator ${imgIndex === (currentImageIndex[index] || 0) ? 'active' : ''}`}
                    />
                  ))}
                </div>
                <div className="card-content">
                  <div 
                    className="basic-info"
                    onClick={(e) => handleBasicInfoClick(index, e)}
                  >
                    <h2>{people[index].name}, {people[index].age}</h2>
                    <p>{people[index].distance}</p>
                  </div>
                </div>
                <div className={`profile-details ${showProfile[index] ? 'show' : ''}`}>
                  <div className="profile-details-content">
                    <div className="profile-section">
                      <h3>About</h3>
                      <p>{people[index].bio}</p>
                      <p>{people[index].about}</p>
                    </div>
                    <div className="profile-section">
                      <h3>Basic Info</h3>
                      <p>üìç {people[index].location}</p>
                      <p>üíº {people[index].occupation}</p>
                      <p>üéì {people[index].education}</p>
                    </div>
                    <div className="profile-section">
                      <h3>Interests</h3>
                      <div className="interests-list">
                        {people[index].interests.map((interest, i) => (
                          <span key={i} className="interest-tag">{interest}</span>
                        ))}
                      </div>
                    </div>
                  </div>
                </div>
              </animated.div>
            </animated.div>
          ))}
          <div className="card-actions">
            <button 
              className="action-button nope" 
              onClick={() => handleButtonClick('left', currentIndex)}
              aria-label="Nope"
            />
            <button 
              className="action-button superlike" 
              onClick={() => handleButtonClick('up', currentIndex)}
              aria-label="Super Like"
            />
            <button 
              className="action-button like" 
              onClick={() => handleButtonClick('right', currentIndex)}
              aria-label="Like"
            />
          </div>
        </div>
      ) : (
        <div className="empty-state">
          <div className="empty-state-icon">üîç</div>
          <h2>No More Profiles Nearby</h2>
          <p>
            Looks like you've explored all potential matches in your area. 
            Expand your search radius or check back later for new people!
          </p>
          <button className="empty-state-refresh" onClick={handleRefresh}>
            Refresh Profiles
          </button>
        </div>
      )}
    </div>
  );
};

export default Discovery;
